#include <iostream>
#include <string>
#include <vector>
#include <map>
using namespace std;

class Solution {
public:
    int maxProduct(vector<string>& words) {
    	int res = 0;
    	vector<int> char_bitmap;
    	for (int i=0; i<words.size(); i++)
    	{
    		char_bitmap.push_back(0);
    		for (char c='a'; c<='z'; c++) {
    			if (words[i].find(c) != string::npos)
    				char_bitmap[i] += 1 << c;
    		}
    	}
    	for (int i=0; i<words.size(); i++)
    		for (int j=i+1; j<words.size(); j++)
	    	{
	    		if (((char_bitmap[i] & char_bitmap[j]) == 0) && words[i].size() * words[j].size() > res)
	    			res =  words[i].size() * words[j].size();
	    	}
        return res;
    }
};

